import React, { useState } from 'react';
import { Eye, EyeOff } from 'lucide-react';
import '../Css/registroAnalista.css';
import { crearAnalista } from "../api/RegistrarAnalista.api"; 

const RegistroForm = () => {
  const [showPassword, setShowPassword] = useState(false);
  const [formData, setFormData] = useState({
    nombre: '',
    primerApellido: '',
    segundoApellido: '',
    personaCedula: '',
    telefono: '',
    correoElectronico: '',
    contrasena: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log('Datos del formulario:', formData);

    try {
      const result = await crearAnalista(formData);
      if (result.success) {
        console.log('Analista creado exitosamente:', result);
      } else {
        console.error('Error al crear el analista:', result.message);
        // Mostrar mensaje de error al usuario
      }
    } catch (error) {
      console.error('Error al enviar los datos:', error);
      // Aquí puedes mostrar un mensaje de error al usuario
    }
  };

  return (
    <div className="registro-container">
      {/* Sección del formulario */}
      <div className="registro-main">
        <div className="registro-form-container">
          <h1 className="registro-title">Crear una cuenta</h1>
          <p className="registro-subtitle">Complete sus datos para comenzar</p>

          <form onSubmit={handleSubmit} className="registro-form">
            <div className="form-grid">
              <div className="form-group">
                <label htmlFor="nombre">Nombre *</label>
                <input
                  type="text"
                  id="nombre"
                  name="nombre"
                  value={formData.nombre}
                  onChange={handleChange}
                  required
                  className="form-input"
                  placeholder="Ingrese su nombre"
                />
              </div>

              <div className="form-group">
                <label htmlFor="primerApellido">Primer Apellido *</label>
                <input
                  type="text"
                  id="primerApellido"
                  name="primerApellido"
                  value={formData.primerApellido}
                  onChange={handleChange}
                  required
                  className="form-input"
                  placeholder="Ingrese su primer apellido"
                />
              </div>

              <div className="form-group">
                <label htmlFor="segundoApellido">Segundo Apellido</label>
                <input
                  type="text"
                  id="segundoApellido"
                  name="segundoApellido"
                  value={formData.segundoApellido}
                  onChange={handleChange}
                  className="form-input"
                  placeholder="Ingrese su segundo apellido"
                />
              </div>

              <div className="form-group">
                <label htmlFor="personaCedula">Cédula *</label>
                <input
                  type="text"
                  id="personaCedula"
                  name="personaCedula"
                  value={formData.personaCedula}
                  onChange={handleChange}
                  required
                  className="form-input"
                  placeholder="Ingrese su número de cédula"
                />
              </div>

              <div className="form-group">
                <label htmlFor="telefono">Teléfono *</label>
                <input
                  type="tel"
                  id="telefono"
                  name="telefono"
                  value={formData.telefono}
                  onChange={handleChange}
                  required
                  className="form-input"
                  placeholder="Ingrese su número de teléfono"
                />
              </div>

              <div className="form-group">
                <label htmlFor="correoElectronico">Correo Electrónico *</label>
                <input
                  type="email"
                  id="correoElectronico"
                  name="correoElectronico"
                  value={formData.correoElectronico}
                  onChange={handleChange}
                  required
                  className="form-input"
                  placeholder="correo@ejemplo.com"
                />
              </div>

              <div className="form-group password-group">
                <label htmlFor="contrasena">Contraseña *</label>
                <div className="password-input-container">
                  <input
                    type={showPassword ? "text" : "password"}
                    id="contrasena"
                    name="contrasena"
                    value={formData.contrasena}
                    onChange={handleChange}
                    required
                    className="form-input"
                    placeholder="Ingrese su contraseña"
                  />
                  <button
                    type="button"
                    className="password-toggle"
                    onClick={() => setShowPassword(!showPassword)}
                  >
                    {showPassword ? <EyeOff className="icon" /> : <Eye className="icon" />}
                  </button>
                </div>
              </div>
            </div>

            <button type="submit" className="submit-button">
              Crear cuenta
            </button>

            <p className="form-footer">
              * Campos obligatorios
            </p>
          </form>
        </div>
      </div>
    </div>
  );
};

export default RegistroForm;
